import React from 'react';
import customButton from './customButton.css';

const SectionButton = ({ label, icon, onClick }) => {

    return (
        <button className={'custom-button grey'} onClick={onClick}>
            <div className='flex flex-col items-start lg:gap-y-10 gap-y-2'>
                <div className='lg:text-3xl font-bold text-xl flex items-center justify-between w-full px-5 gap-x-3'>
                    {label}
                    {icon && <i className={`${icon}`}></i>}                    
                </div>
            </div>
        </button>
    );
};

export default SectionButton;
